  "ui.dataset.hint.descriptionTitle": "Beschreibung",
  "ui.dataset.hint.description": "<div className='flex flex-col gap-2'><div>Offene Daten stellen eine wichtige Chance dar, um die Ziele für nachhaltige Entwicklung zu erreichen, indem sie dazu beitragen, technische Innovationen zu beschleunigen, indem sie ermöglichen, dass Software- und KI-Modelle präziser sind und somit ihre potenziellen positiven Auswirkungen auf die Entwicklung vertiefen. Durch einen besseren Zugang zu Daten können politische Entscheidungsträger mit den Informationen und dem Wissen ausgestattet werden, um fundierte Entscheidungen zu treffen und gleichzeitig eine größere Rechenschaftspflicht und Transparenz zu fördern.</div><div> Auf dieser Registerkarte findest du Links zu frei verfügbaren Datensätzen, die dir bei deinen eigenen Initiativen zur digitalen Transformation helfen können. Wichtige Dokumentation ist ebenfalls verfügbar, einschließlich einer Beschreibung des Datensatzes, der Organisation, die ihn verwaltet, Informationen zu Aktualisierungen und Lizenzen, der Branche, für die er Daten bereitstellt, der geografischen Abdeckung usw.</div></div>",

