  "ui.playbook.hint.characteristics": "Playbooks unterstützen bei der Beantwortung häufiger Fragen, wie beispielsweise der Frage, wie man einen Anwendungsfall ansetzt, einen Arbeitsablauf anwendet, ein Produkt einsetzt, mit einem Partner zusammenarbeitet oder sogar Kapazitäten innerhalb eines Teams aufbaut. Sie bestehen aus mehreren Komponenten:<ul><li>Zielgruppe: die beabsichtigten Nutzer des Anleitungsmaterials</li><li>Ergebnisse: das beabsichtigte Ergebnis des Playbooks</li><li>Spiele: die Kombination von Aufgaben (Handlungen), die eine Gruppe erledigen muss, um eine Aktion auszuführen. Jedes Playbook kann eine Reihe von Spielen enthalten. Spiele können wiederverwendet und zu mehreren Playbooks hinzugefügt werden.</li><li>Handlungen: die einzelnen Aufgaben, aus denen ein Spiel besteht. Jedes Spiel kann mehrere Handlungen umfassen, und Handlungen können auch zu externen Quellen verlinkt sein.</li></ul>",
  "ui.playbook.hint.description": "Jedes Playbook hat eine individuelle Quelle, wie aufgeführt. Wenn Sie einen Inhalt haben, den Sie gerne in ein Playbook umwandeln möchten, wenden Sie sich an unser Team unter issues@exchange.dial.global",
  "ui.playbook.hint.createPlaybooks": "Registriere dich oder melde dich an, um Playbooks zu erstellen",

